function timer(date) {
  var dateLater = new Date(date) - new Date();
  var day = Math.floor(dateLater / 1000 / 60 / 60 / 24);
  var hour = Math.floor(dateLater / 1000 / 60 / 60) - day * 24;
  var mins = Math.floor(dateLater / 1000 / 60) - day * 24 * 60 - hour * 60;

  if (day <= 9) {
    if (day < 0) {
      $('.day1').html('0');
      $('.day2').html('0');
    } else {
      $('.day1').html('0');
      $('.day2').html(day);
    }
  } else {
    $('.day1').html(String(day)[0]);
    $('.day2').html(String(day)[1]);
  }

  if (hour <= 9) {
    if (hour < 0) {
      $('.hour1').html('0');
      $('.hour2').html('0');
    } else {
      $('.hour1').html('0');
      $('.hour2').html(hour);
    }
  } else {
    $('.hour1').html(String(hour)[0]);
    $('.hour2').html(String(hour)[1]);
  }

  if (mins <= 9) {
    if (mins < 0) {
      $('.min1').html('0');
      $('.min2').html('0');
    } else {
      $('.min1').html('0');
      $('.min2').html(mins);
    }
  } else {
    $('.min1').html(String(mins)[0]);
    $('.min2').html(String(mins)[1]);
  }

  return date;
}

